import React from "react";
import { Card, Avatar } from 'antd';

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">짹짹<br/>0</div>,
                <div key="followings">짹짹<br/>0</div>,
                <div key="followings">짹짹<br/>0</div>,
            ]}
        >
            <Card.Meta
                avatar={<Avatar>ZC</Avatar>}
                title="ZeroCho"
            />
        </Card>
    );
};

export default UserProfile;
